import styled from "styled-components";
import { motion } from "framer-motion";

const TopicHomeComponentsStyle = styled(motion.div)`
  position: relative;
  margin-top: 150px;
  margin-left: 10%;
  width: 80%;
  height: 600px;
  background-color: black;
  display: flex;
  justify-content: center;
  align-items: center;
  .title {
    padding: 40px;
    height: auto;
    .mainTitle {
      font-size: 50px;
      color: #f1f1f1;
      margin-bottom: 40px;
    }
    .posts {
      font-size: 18px;
      color: #f1f1f199;
    }
  }
`;

const TopicHomeComponents = () => {
  return (
    <TopicHomeComponentsStyle>
      <div className="title">
        <span className="mainTitle">Travel</span>
        <br />
        <span className="posts">240 article</span>
      </div>
    </TopicHomeComponentsStyle>
  );
};

export default TopicHomeComponents;
